INSERT INTO `user_behavior_config` VALUES (1,'音乐练习统计','音乐练习',0,0,'select DATE_FORMAT(mp.practice_date,\'%Y-%m-%d\') as date,mi.name,mp.minutes as value from music_practice mp,music_instrument mi  where mp.music_instrument_id = mi.id \r\n','mp.practice_date','mp.user_id','分钟','mi.name','select name from music_instrument order by order_index','\0',1,'',3,1,NULL,'2017-09-04 20:17:04','2018-02-19 10:19:30'),(2,'运动锻炼统计','运动锻炼',1,0,'select DATE_FORMAT(mp.exercise_date,\'%Y-%m-%d\') as date,mi.name,mp.minutes as value from sport_exercise mp,sport_type mi \r\nwhere mp.sport_type_id =mi.id\r\n\r\n','mp.exercise_date','mp.user_id','分钟','mi.name','select name from sport_type order by order_index','\0',1,NULL,3,1,NULL,'2017-09-04 20:30:36','2018-02-19 10:20:01'),(3,'某项人生经历统计','某项人生经历',5,0,'select DATE_FORMAT(start_date,\'\'%Y-%m-%d\'\') as date,\r\n    case \r\n     when type=0 then \'\'生活\'\'\r\n     when type=1 then \'\'工作\'\'\r\n     when type=2 then \'\'旅行\'\'\r\n     when type=3 then \'\'读书\'\'\r\n     else \'\'其他\'\' END\r\n	as name,\r\n    days as value from life_experience where type={0}\r\n','start_date','user_id','天','name',NULL,'',1,NULL,3,1,NULL,'2017-09-04 20:37:14','2018-02-19 10:20:29'),(4,'看病统计','看病',3,0,'select DATE_FORMAT(treat_date,\'%Y-%m-%d\') as date,\'看病\' as name,1 as value from treat_record\r\n','treat_date','user_id','次','hospital,department,organ,disease,diagnosed_disease','select distinct disease from treat_record ','\0',1,'',3,1,NULL,'2017-09-04 20:39:31','2018-02-19 10:20:50'),(5,'身体不适统计','身体不适',3,0,'select DATE_FORMAT(occur_date,\'%Y-%m-%d\') as date,disease as name,last_days as value from body_abnormal_record\r\n','occur_date','user_id','次','organ,disease','select distinct disease from body_abnormal_record','',1,'',3,1,NULL,'2017-09-04 20:56:04','2018-02-19 10:21:11'),(6,'消费统计','消费',2,0,'select distinct DATE_FORMAT(consume_date,\'%Y-%m-%d\') as date,\'消费\' as name,1 as value from buy_record\r\n','consume_date','user_id','次','goods_name,keywords,shop_name,remark',NULL,'\0',1,'\0',3,1,NULL,'2017-09-04 20:59:33','2018-02-19 10:21:32'),(7,'看书统计','看书',4,0,'select DATE_FORMAT(read_time,\'%Y-%m-%d\') as date,\'看书\' as name,\r\nminutes as value from reading_record_detail\r\n','read_time','user_id','分钟',NULL,NULL,'\0',1,'',3,1,NULL,'2017-09-05 11:48:16','2018-02-19 10:21:48'),(8,'加班统计','加班',7,0,'select DATE_FORMAT(work_date,\'%Y-%m-%d\') as date,\'加班\' as name,round(hours) as value from work_overtime\r\n','work_date','user_id','小时',NULL,NULL,'\0',1,'',3,1,NULL,'2017-09-05 12:18:35','2018-02-19 10:22:02'),(9,'出差统计','出差',7,0,'select DATE_FORMAT(trip_date,\'%Y-%m-%d\') as date,\'出差\' as name,days as value from business_trip\r\n','trip_date','user_id','天','country,province,city',NULL,'',1,'',3,1,NULL,'2017-09-05 12:20:00','2018-02-19 10:22:22'),(10,'某项消费记录统计(一层分类)','某项消费记录(一层分类)',2,0,'select distinct DATE_FORMAT(consume_date,\'\'%Y-%m-%d\'\') as date,gt.behavior_name as name,1 as value \r\nfrom buy_record br,goods_type gt where br.goods_type_id=gt.id and br.goods_type_id={0}\r\n','br.consume_date','br.user_id','次',NULL,NULL,'\0',1,NULL,3,7,NULL,'2017-09-06 16:06:24','2018-02-19 10:24:49'),(11,'某项消费记录统计(两层分类)','某项消费记录统计(两层分类)',2,0,'select distinct DATE_FORMAT(consume_date,\'\'%Y-%m-%d\'\') as date,gt.behavior_name as name,1 as value \r\nfrom buy_record br,goods_type gt where br.sub_goods_type_id=gt.id and br.goods_type_id={0} and br.sub_goods_type_id={1} \r\n','br.consume_date','br.user_id','次',NULL,NULL,'\0',1,NULL,3,8,NULL,'2017-09-06 16:08:33','2018-02-19 10:25:55'),(12,'操作日志统计','操作日志',6,0,'select DATE_FORMAT(occur_end_time,\'%Y-%m-%d\') as date,\'操作日志\' as name,1 as value from operation_log\r\n','occur_end_time','user_id','次','paras',NULL,'\0',1,'\0',3,9,NULL,'2017-09-07 11:07:10','2018-02-19 10:26:16'),(13,'回家统计','回家',2,0,'select DATE_FORMAT(consume_date,\'%Y-%m-%d\') as date,\'回家\' as name,1 as value from buy_record where keywords like \'%回家%\' and goods_name like \'%临海\'\r\n','consume_date','user_id','次','goods_name,keywords,shop_name,remark',NULL,'\0',1,'',3,1,'需要注意的是商品名需要以临海结尾','2017-09-14 09:02:11','2018-02-19 10:22:51'),(14,'用药统计','用药',3,0,'select distinct DATE_FORMAT(tdd.occur_time,\'%Y-%m-%d\') as date,\'吃药\' as name,1 as value from treat_drug_detail tdd,treat_drug td where tdd.treat_drug_id=td.id\r\n','tdd.occur_time','tdd.user_id','次','td.name','select distinct name from treat_drug','\0',1,'',3,1,NULL,'2017-09-14 10:56:17','2018-02-19 10:23:15'),(16,'通用数据统计','通用数据',8,0,'select DATE_FORMAT(cr.occur_time,\'%Y-%m-%d\') as date,crt.name,cr.value as value from common_record cr,common_record_type crt  where cr.common_record_type_id = crt.id and crt.month_stat=1\r\n','cr.occur_time','cr.user_id','分钟','crt.name','select name from common_record_type where year_stat=1','\0',1,'',3,1,NULL,'2017-10-14 22:13:01','2018-02-19 10:23:51');
